import React from 'react';
import { Row, Col } from 'react-bootstrap';
import products from '../products.js';
import Product from '../components/Product';

const HomeScreen = () => {
  return (
    <div>
      <h1>Latest Products</h1>
      <Row>
        {products.map((item) => (
          <Col sm={10} md={4} lg={4} xl={2}>
            <Product item={item} />
          </Col>
        ))}
      </Row>
    </div>
  );
};

export default HomeScreen;
